        public static string RationalCTableAsHtml(string r)
        {
            string s = "<h1>Rational C Values for " + r  + "</h1>";
            s += "<table style='border-style: solid;'>";
            string values = StaticLookupTables.RationalCValues(r); // \t for vlue \n for row 
            string[] rows = values.Split(new String[] { "\n" }, StringSplitOptions.RemoveEmptyEntries);
            string[] col_headers = RationalCColumnHeader.Split(new String[] { "\n" }, StringSplitOptions.RemoveEmptyEntries);
            string[] row_headers = RationalCRowHeader.Split(new String[] { "\n" }, StringSplitOptions.RemoveEmptyEntries);

            s += "<tr><td colspan=5></td><td colspan=11>Percent Directly Connected Impervious Area</td><td colspan=5></td></tr>";

            s += "<tr><td>NDCIA</td>";
            for (int i = 0; i < row_headers.Length; i++) { s += "<td>" + row_headers[i] + "</td>"; }
            s += "</tr>";

            for (int i = 0;  i < rows.Length; i++)
            {
                s += "<tr>";
                s += "<td>" + col_headers[i] + "</td>";
                string[] cell_values = rows[i].Split(new String[] { "\t" }, StringSplitOptions.RemoveEmptyEntries);
                for (int j = 0; j < cell_values.Length; j++)
                {
                    s += "<td>" + cell_values[j] + "</td>";
                }
                s += "</tr>";
            }
            s += "</table>";
            return s;

        }

